import {Fragments} from 'react'
import { useParams } from 'react-router-dom'
const QuoteDetail=(props)=>{
    const params=useParams();
    return (
    <Fragments>
        <h1>Quotes Details</h1>

        <h1>{params.quoteId}</h1>
    </Fragments>
    );
}
export default QuoteDetail
